import React, { Component } from 'react'
import './App.css'
import FormComponent from './FormComponent'

class CalculationComponent extends FormComponent {
  render() {
    return (
      <div>
        <p>Height={this.props}</p>
      </div>
    )
  }
}

export default CalculationComponent
